
IF NOT EXISTS (SELECT TOP (1) [Id] FROM [Identity].[User])
BEGIN 

    DECLARE @CreatedUserId NVARCHAR(36) = N'2a9b3450-1feb-4be3-ab94-24e64cd34829'
            

    -- remember first time passwords to prevent them being re-used
    SELECT [Id], [PasswordHash], SYSUTCDATETIME() FROM [Identity].[User]
    WHERE [PasswordHash] IS NOT NULL;
END